  -webkit-user-select: none;
  user-select: none;
  -webkit-touch-callout: none;
  -khtml-user-select: none;
  touch-action: pan-y;
  -webkit-tap-highlight-color: transparent;
}

.slick-list
{
  position: relative;
  display: block;
  overflow: hidden;
  margin: 0;
  padding: 0;
}

.slick-list:focus
{
  outline: none;
}

.slick-list.dragging
{
  cursor: pointer;
  cursor: hand;
}

.slick-slider .slick-track,
.slick-slider .slick-list
{
  transform: translate3d(0, 0, 0);
}

.slick-track
{
  position: relative;
  top: 0;
  left: 0;
  display: block;
  margin-left: auto;
  margin-right: auto;
}

.slick-track:before,
.slick-track:after
{
  display: table;
  content: '';
}

.slick-track:after
{
  clear: both;
}

.slick-loading .slick-track
{
  visibility: hidden;
}

.slick-slide
{
  display: none;
  float: left;
  height: 100%;
  min-height: 1px;
}

[dir='rtl'] .slick-slide
{
  float: right;
}

.slick-slide img
{
  display: block;
}

.slick-slide.slick-loading img
{
  display: none;
}

.slick-slide.dragging img
{
  pointer-events: none;
}

.slick-initialized .slick-slide
{
  display: block;
}

.slick-loading .slick-slide
{
  visibility: hidden;
}

.slick-vertical .slick-slide
{
  display: block;
  height: auto;
  border: 1px solid transparent;
}

.slick-arrow.slick-hidden {
  display: none;
}

/* Icons */

@font-face
{
  font-family: 'slick';

  font-weight: normal;

  font-style: normal;

  src: url(/static/media/slick.a4e97f5a.eot);

  src: url(/static/media/slick.a4e97f5a.eot?#iefix) format('embedded-opentype'), url(/static/media/slick.29518378.woff) format('woff'), url(/static/media/slick.c94f7671.ttf) format('truetype'), url(/static/media/slick.2630a3e3.svg#slick) format('svg');
}

/* Arrows */

.slick-prev,
.slick-next
{
  font-size: 0;
  line-height: 0;
  position: absolute;
  top: 50%;
  display: block;
  width: 20px;
  height: 20px;
  padding: 0;
  transform: translate(0, -50%);
  cursor: pointer;
  color: transparent;
  border: none;
  outline: none;
  background: transparent;
}

.slick-prev:hover,
.slick-prev:focus,
.slick-next:hover,
.slick-next:focus
{
  color: transparent;
  outline: none;
  background: transparent;
}

.slick-prev:hover:before,
.slick-prev:focus:before,
.slick-next:hover:before,
.slick-next:focus:before
{
  opacity: 1;
}

.slick-prev.slick-disabled:before,
.slick-next.slick-disabled:before
{
  opacity: .25;
}

.slick-prev:before,
.slick-next:before
{
  font-family: 'slick';
  font-size: 20px;
  line-height: 1;
  opacity: .75;
  color: white;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}

.slick-prev
{
  left: -25px;
}

[dir='rtl'] .slick-prev
{
  right: -25px;
  left: auto;
}

.slick-prev:before
{
  content: '';
}

[dir='rtl'] .slick-prev:before
{
  content: '';
}

.slick-next
{
  right: -25px;
}

[dir='rtl'] .slick-next
{
  right: auto;
  left: -25px;
}

.slick-next:before
{
  content: '';
}

[dir='rtl'] .slick-next:before
{
  content: '';
}

/* Dots */

.slick-dotted.slick-slider
{
  margin-bottom: 30px;
}

.slick-dots
{
  position: absolute;
  bottom: -25px;
  display: block;
  width: 100%;
  padding: 0;
  margin: 0;
  list-style: none;
  text-align: center;
}

.slick-dots li
{
  position: relative;
  display: inline-block;
  width: 20px;
  height: 20px;
  margin: 0 5px;
  padding: 0;
  cursor: pointer;
}

.slick-dots li button
{
  font-size: 0;
  line-height: 0;
  display: block;
  width: 20px;
  height: 20px;
  padding: 5px;
  cursor: pointer;
  color: transparent;
  border: 0;
  outline: none;
